  const { id } = useParams();

  const tour = tourData.find((tour) => tour.id === id);

  const { photo, title, desc, price, reviews, city, distance, maxGroupSize } =
    tour;

  return;
  <section>
    <Container>
      <Row>
        <Col lg="12"></Col>
      </Row>
    </Container>
  </section>;
};

export default TourDetail;
